import React from "react";
import { Link } from "react-router-dom";

const NavigationBar = () => {
    return (
        <header>
            <nav>
                <Link to="/posts">Posts</Link>
                <Link to="/profile">Pro</Link>
            </nav>
        </header>
    )
}

export default NavigationBar
